INSERT INTO `activities` (`Id`, `Title`, `Short`, `ArrangedAt`, `Info`, `Preview`, `Theme`, `Type`) VALUES
(5, 'Искусственный интеллект в бизнесе', 'Узнайте о последних трендах, успешных кейсах и инструментах, которые помогут повысить эффективность и конкурентоспособность вашей компании.', '2025-09-11', '<p>Вебинар «Искусственный интеллект в бизнесе: практические кейсы и тренды 2025» — это онлайн-сессия, ориентированная на тех, кто хочет понять, как современные технологии ИИ могут трансформировать бизнес-процессы и открыть новые возможности для роста. В ходе вебинара эксперты расскажут о ключевых направлениях использования ИИ: автоматизация рутинных задач, анализ больших данных, персонализация клиентского опыта и прогнозирование рыночных трендов.</p><p><br></p><p>Особое внимание будет уделено реальным примерам успешного внедрения ИИ в различных отраслях — от розничной торговли и финансов до производства и маркетинга. Вы узнаете, какие инструменты и платформы сегодня наиболее востребованы, а также получите рекомендации по выбору решений под конкретные задачи.</p><p><br></p><p>Вебинар будет полезен как руководителям и владельцам бизнеса, так и IT-специалистам, заинтересованным в развитии навыков работы с искусственным интеллектом. В конце сессии предусмотрена интерактивная часть с ответами на вопросы участников.</p><p><br></p><p>Для участия достаточно зарегистрироваться на сайте мероприятия. Вебинар проводится бесплатно, доступ будет открыт всем зарегистрированным пользователям. Не упустите шанс получить актуальные знания и вдохновение для внедрения ИИ в ваш бизнес!</p><p>Сслыка: <a href=\"https://vebinar-ai.ru\" target=\"_blank\" style=\"color: rgb(102, 163, 224);\">https://vebinar-ai.ru</a></p>', 'ai.jpg', 'ИИ', 4),
(6, 'Кибербезопасность в 2025 году', 'Приглашаем специалистов и руководителей на вебинар, посвящённый актуальным методам защиты информационных систем и данных в условиях растущих киберугроз. Узнайте, как эффективно предотвратить атаки и минимизировать риски для вашего бизнеса.', '2025-07-04', '<p>Вебинар «Кибербезопасность в 2025: как защитить бизнес от современных угроз» — это онлайн-мероприятие, направленное на повышение осведомлённости и практических навыков в области защиты корпоративных информационных систем. В условиях постоянного роста числа и сложности кибератак, грамотная стратегия безопасности становится ключевым фактором устойчивости бизнеса.</p><p><br></p><p>В ходе вебинара эксперты расскажут о новых типах угроз, таких как фишинг, ransomware, атаки на облачные сервисы и IoT-устройства. Вы узнаете о современных инструментах и подходах к мониторингу, обнаружению и реагированию на инциденты, а также о важности обучения сотрудников и построения культуры безопасности в компании.</p><p><br></p><p>Особое внимание будет уделено практическим рекомендациям по внедрению многоуровневой защиты, управлению доступом и резервному копированию данных. В конце сессии участники смогут задать вопросы и получить персональные советы от специалистов.</p><p><br></p><p>Вебинар будет полезен IT-специалистам, руководителям отделов безопасности, а также владельцам бизнеса, стремящимся защитить свои активы и репутацию. Участие бесплатное, регистрация открыта на официальном сайте. Не упустите возможность повысить уровень кибербезопасности вашей организации!</p><p>Ссылка: <a href=\"https://cybersecurity-vebinar.ru/info\" target=\"_blank\" style=\"color: rgb(102, 163, 224);\">https://cybersecurity-vebinar.ru/info</a></p>', 'cybersecurity.jpg', 'Кибербезопасность', 4);

