INSERT INTO `events_` (`Id`, `Title`, `Short`, `ArrangedAt`, `Info`, `Preview`, `Theme`, `Type`) VALUES
(5, 'IT-Хакатон «Технологии для общества»', 'Приглашаем разработчиков принять участие в хакатоне, посвящённом созданию цифровых решений для социальных и экологических проблем. За 48 часов команды разработают проекты, направленных на улучшение городской среды и развитие благотворительности.', '2025-08-14', '<p>Хакатон «Технологии для общества: создаём будущее вместе» — это интенсивное 48-часовое соревнование, где участники из разных областей IT смогут объединить свои знания и навыки для создания инновационных проектов с социальной значимостью. В рамках мероприятия будут предложены темы, связанные с улучшением городской инфраструктуры, экономикой совместного потребления, экологией, ЖКХ, а также развитием местных сообществ и благотворительных инициатив.</p><p><br></p><p>Участников ждут лекции и мастер-классы от ведущих экспертов в области интернет-технологий, дизайна, разработки мобильных приложений и интернет-маркетинга. Менторы помогут командам с техническими и организационными вопросами, а лучшие проекты получат грант в размере 70 000 рублей на дальнейшую доработку и внедрение.</p><p><br></p><p>Мероприятие создаёт уникальную площадку для обмена опытом, нетворкинга и совместной работы над реальными задачами, которые могут изменить жизнь общества к лучшему. Присоединяйтесь, чтобы внести свой вклад в цифровое будущее и получить ценный опыт командной работы в IT-сфере.</p><p><br></p><p>Организаторы обеспечат комфортные условия для работы, включая стабильный интернет, рабочие зоны и питание. Регистрация открыта до 1 сентября 2025 года. Участие бесплатное, но количество мест ограничено.</p><p><br></p><p>Это мероприятие вдохновлено успешными практиками проведения IT-хакатонов, направленных на решение общественно значимых проблем с помощью современных технологий и интернета</p>', 'hackathone.jpg', 'Хакатон', 3),
(6, 'AI Revolution', 'Конференция посвящена последним трендам в области искусственного интеллекта и машинного обучения. Участники узнают, как внедрять AI-решения в бизнес-процессы и повседневную жизнь.', '2025-09-07', '<p>Искусственный интеллект стремительно меняет мир, и чтобы оставаться на волне технологического прогресса, важно понимать его возможности и перспективы. Конференция \"AI Revolution: Будущее искусственного интеллекта в бизнесе и жизни\" соберёт ведущих экспертов, предпринимателей и разработчиков для обсуждения ключевых вопросов:</p><p><br></p><ul><li>Главные тренды AI в 2025 году – какие технологии станут прорывными?</li><li>Практическое применение ИИ – кейсы из fintech, медицины, ритейла и других отраслей.</li><li>Этика и регулирование – как избежать рисков при внедрении AI?</li><li>Инструменты для разработчиков – какие фреймворки и платформы стоит освоить?</li></ul><p><br></p><p>Формат мероприятия:</p><ul><li>Ключевые доклады – выступления лидеров индустрии.</li><li>Панельные дискуссии – открытые дебаты о будущем AI.</li><li>Воркшопы – практические занятия по созданию AI-моделей.</li><li>Нетворкинг – возможность пообщаться с единомышленниками и потенциальными партнёрами.</li></ul><p><br></p><p>Для кого это мероприятие?</p><ul><li>Разработчики и data scientists</li><li>Владельцы бизнеса и стартаперы</li><li>Технологические энтузиасты и студенты</li></ul><p><br></p><p>Место проведения:</p><p>Москва, КВЦ \"Экспоцентр\".</p><p><br></p><p>Регистрация уже открыта! Успейте занять место – количество участников ограничено.</p><p>Конференция посвящена последним трендам в области искусственного интеллекта и машинного обучения. Участники узнают, как внедрять AI-решения в бизнес-процессы и повседневную жизнь.</p>', 'AI.jpg', 'ИИ', 3),
(7, 'Информационная безопасность', 'Открытое мероприятие по информационной безопасности', '2025-07-20', '<h3>Цель мероприятия</h3><p>Главная цель - повысить осведомленность о современных угрозах информационной безопасности, обменяться опытом и лучшими практиками, а также познакомить участников с новейшими технологиями и методами защиты информации. В программе запланированы лекции ведущих экспертов, практические мастер-классы и круглые столы, где можно будет обсудить актуальные проблемы и найти эффективные решения.</p><h3>Для кого это мероприятие?</h3><ul><li>Специалисты в области IT и кибербезопасности</li><li>Руководители компаний и подразделений, отвечающих за безопасность данных</li><li>Студенты и преподаватели технических специальностей</li><li>Все, кто интересуется вопросами защиты информации и хочет повысить уровень своей цифровой грамотности</li></ul><h3>Основные темы</h3><ul><li>Современные киберугрозы и методы их предотвращения</li><li>Защита персональных данных и корпоративной информации</li><li>Безопасность в облачных сервисах и мобильных приложениях</li><li>Законодательство в сфере информационной безопасности</li><li>Практические навыки реагирования на инциденты и восстановление данных</li></ul><h3>Почему важно участвовать?</h3><p>Информационная безопасность — это не только техническая задача, но и ответственность каждого пользователя. Участие в таком мероприятии поможет вам:</p><ul><li>Лучше понять риски</li><li>Научиться защищать свои данные</li><li>Эффективно реагировать на возможные угрозы</li></ul><p>Это отличная возможность расширить профессиональные знания, завести полезные знакомства и быть в курсе последних тенденций в области кибербезопасности.</p><p>Приглашаем всех заинтересованных принять участие в мероприятии и сделать свой вклад в создание безопасного цифрового пространства!</p>', 'general_event.jpg', 'Кибербезопасность', 3);

