INSERT INTO `posts` (`Id`, `Title`, `Short`, `Published`, `Info`, `Preview`, `Theme`, `Type`) VALUES
(31, 'Как познакомиться и начать общение с новыми людьми', 'Помощь соц. сетей. Итак, как мы все знаем, и как это у всех нас было, наши кураторы добавляют нас в одну беседу, и вот мы уже имеем представление о тех, с кем нам предстоит учиться. И в этот самый момент мы можем подготовиться к личной встрече.', '2025-07-24', '<p class=\"ql-align-center\">	<strong style=\"background-color: transparent;\">Как познакомиться и начать общение с новыми людьми</strong></p><p class=\"ql-align-justify\">	<strong>1) Помощь соц. сетей. </strong>Итак, как мы все знаем, и как это у всех нас было, наши кураторы добавляют нас в одну беседу, и вот мы уже имеем представление о тех, с кем нам предстоит учиться. И в этот самый момент мы можем подготовиться к личной встрече. А именно проверить их страницы во ВКонтакте. Скорее всего, там будет хоть что-то говориться об их увлечениях и интересах. Так можно найти тех, с кем у вас схожи интересы или с кем вам, по крайней мере, будет интересно поговорить. Благодаря этой подготовке вам будет немного спокойнее при офлайн встрече, и вы будите примерно понимать о чём и с кем говорить. К сожалению, это не самый универсальный метод и подойдет только в том случае если у вас будет страница человека в соц. сетях.&nbsp;</p><p class=\"ql-align-justify\">	<strong>2) Находитесь непосредственно рядом с людьми.</strong> Во-первых, чтобы стать частью диалога нужно знать о чём он. Поэтому рекомендуем вам стоять недалеко от ваших одногруппников, и так же советуем выбрать компанию более активных и разговорчивых людей, так как зачастую именно с такими людьми проще всего завязать диалог. Просто стойте рядом с ними и, когда поймете, о чем речь, можно будет дать какой-нибудь комментарий по ней. Не нужно его выкрикивать, но он должен быть достаточно громкий, чтобы его услышал хотя бы один человек из этой группы. Так как именно после этого вы скорее всего станете полноценным участником разговора. Однако, не забывайте, что комментарий должен быть не один и не должен кого-либо оскорблять. Просто периодически вкидывайте их в разговор и обычно после такого хотя бы один человек из этой группы тоже захочет побольше с вами общаться.</p><p class=\"ql-align-justify\">	<strong>3) Метод «выжидание одиночки».</strong> Лично я его так называю. Несмотря на немного странное название, он довольно надёжный. Он подойдет для тех, кто очень стеснительный и боится заговорить с людьми. Зачастую люди образуют так называемые «группы общения» и они могут организовать их даже в первый день встречи. Но более застенчивые люди редко могут сразу вписаться в них, поэтому этот метод может помочь. Переждите неделю или около того, и вы с 90% вероятностью найдёте одиночку, т.&nbsp;е. человека, который, как и вы не вписался ни в одну группу. И дальше нужно действовать. Здесь уже нужно пересилить стеснение и неловкость и заговорить с ним о чём угодно. Можно даже прямо сказать, что вы «два одиноких волка в этом лесу», и поэтому вам нужно держаться вместе. Лично я так и делала, ждала неделю и потом подходила к такой же одиночке как я и предлагала зависать вместе. И пока что никто не отказывал. Для этого метода необходимо терпение, но оно того стоит.&nbsp;</p><p class=\"ql-align-center\">	<strong style=\"color: rgb(34, 34, 34);\">Проявляйте инициативу</strong></p><p class=\"ql-align-justify\">	<strong>1) Приходите до начала занятий и беседуйте со студентами.</strong>&nbsp;<span style=\"background-color: transparent;\">Если прийти на десять минут раньше, то у вас останется время поболтать с одногруппниками. Конечно, завязать беседу с незнакомыми людьми не всегда просто. Вы можете начать ее с обсуждения домашнего задания, новой темы или чудаковатого преподавателя.</span></p><p class=\"ql-align-justify\">	<strong style=\"background-color: transparent;\">2) Приглашайте людей на прогулки.</strong><span style=\"background-color: transparent;\">&nbsp;Не ждите, пока другие пригласят вас. Проявите инициативу и пригласите одногруппников или соседей по комнате на чашку кофе, вечернику или тренировку в зале. Не волнуйтесь, при этом вы не будете выглядеть странно или одиноко. Сознательные усилия помогут вам найти единомышленников, которые оценят подобный шаг.</span></p><p class=\"ql-align-justify\">	<span style=\"background-color: transparent;\">Выполняйте вместе с другими повседневные дела — обедайте, готовьтесь к занятиям, ходите на тренировки, чтобы общаться с людьми, несмотря на плотный график.</span></p><p class=\"ql-align-justify\">	<span style=\"background-color: transparent;\">Если вы не любите шумные компании, то предложите новым знакомым посмотреть фильм.</span></p><p class=\"ql-align-justify\">	<strong style=\"background-color: transparent;\">3) Ходите на различные мероприятия.</strong><span style=\"background-color: transparent;\">&nbsp;Невозможно найти друзей, если все время сидеть у себя в комнате. Одевайтесь, делайте глубокий вдох и отправляйтесь на футбольный матч, танцевальную репетицию, вечеринку или концерт. На таких мероприятиях можно встретить немало потенциальных друзей. Вдобавок, чем больше вы знаете о событиях в университете, тем больше поводов для разговора с однокурсниками.</span></p><p class=\"ql-align-justify\">	<strong style=\"background-color: transparent;\">4) Выполняйте домашнее задание в людных местах.</strong><span style=\"background-color: transparent;\">&nbsp;Конечно, готовиться к экзаменам лучше одной в библиотеке, но в остальные моменты домашнее задание можно выполнять в студенческом клубе или кафе. Выберите дружески настроенного студента и начните беседу.</span></p><p class=\"ql-align-justify\">	<strong style=\"background-color: transparent;\">5) Принимайте приглашения.</strong><span style=\"background-color: transparent;\">&nbsp;Если вас приглашают в кафе, на ужин или вечеринку, то обязательно соглашайтесь! Не совершайте поступков, которые идут вразрез с вашей системой ценностей, но и не забывайте выходить из зоны комфорта, чтобы заводить новые знакомства. Если вы не любите шумные вечеринки, то не вынуждайте себя ходить на дискотеки или пить алкоголь. Существует множество других способов познакомиться и весело провести время.</span></p><p><br></p><p class=\"ql-align-center\">	<strong style=\"background-color: transparent; color: rgb(34, 34, 34);\">Участвуйте в общественной жизни</strong></p><p><br></p><p class=\"ql-align-justify\">	<strong style=\"background-color: transparent;\">1) Найдите занятие по интересам.</strong><span style=\"background-color: transparent;\">&nbsp;Узнайте все доступные варианты в студенческом совете или на сайте университета. Наверняка вам доступны различные курсы, секции, кружки, художественные занятия и общественные организации. Выберите себе занятие по душе и знакомьтесь с людьми, которые разделяют ваши интересы.</span></p><p class=\"ql-align-justify\">	<strong style=\"background-color: transparent;\">2) Станьте участником спортивной команды.</strong><span style=\"background-color: transparent;\">&nbsp;Запишитесь в любители, если желаете познакомиться с новым видом спорта. Если же у вас есть определенная подготовка, то станьте членом команды, которая участвует в соревнованиях. Ничто так не скрепляет людей, как совместное стремление к победе, общие усилия и успех. Если вас не интересуют соревнования, то приходите на случайные матчи пару раз в неделю или занимайтесь в тренажерном зале.</span></p><p class=\"ql-align-justify\">	<strong style=\"background-color: transparent;\">3) Станьте волонтером.</strong><span style=\"background-color: transparent;\">&nbsp;Если в школе у вас было призвание помогать людям, то попробуйте стать волонтером. В университете есть волонтерские организации, к которым можно присоединиться. Такая работа позволяет вырваться за пределы университета, помогать людям и встретить единомышленников.</span></p><p class=\"ql-align-justify\">	<strong style=\"background-color: transparent;\">4) Найдите работу, в которой нужно много общаться с людьми.</strong><span style=\"background-color: transparent;\">&nbsp;Можно работать репетитором для однокурсников, официантом или консультантом в магазине. Так вы не только заработаете лишние деньги, но и разовьете свой навык общения! Это поможет в дальнейшем знакомстве с кем-либо. Также вы можете найти работу на территории студенческого городка, чтобы общаться со сверстниками.&nbsp;</span></p><p class=\"ql-align-justify\">	<strong style=\"background-color: transparent;\">5) Станьте членом студенческой организации.</strong><span style=\"background-color: transparent;\">&nbsp;Братства подходят не для всех, но они позволяют ощутить дух единства. Поспешите, если организация заинтересовала вас. Если вам что-то не понравится, то всегда можно прекратить членство. Запишитесь в актив университета. Различные мероприятия и совместная работа сближает людей и во время этого невозможно обойтись без маломальского общения.&nbsp;</span></p><p><br></p><p class=\"ql-align-justify\">	<strong style=\"background-color: transparent;\">&nbsp;&nbsp;6) Старайтесь выглядеть дружелюбно.</strong><span style=\"background-color: transparent;\">&nbsp;Когда человек нервничает или ощущает неловкость, у него часто возникает желание бездумно смотреть на экран смартфона, чтобы выглядеть занятым. Так вы ни с кем не познакомитесь. Отложите смартфон в сторону и задействуйте легкий, уверенный, язык тела: улыбайтесь, стойте ровно и поддерживайте зрительный контакт с окружающими. Вам нужно выглядеть дружелюбно и открыто.</span></p><p class=\"ql-align-justify\">	<span style=\"background-color: transparent;\">&nbsp;- Не скрещивайте руки и не изучайте пол под ногами.</span></p><p class=\"ql-align-justify\">	<span style=\"background-color: transparent;\">&nbsp;- Имитируйте </span><a href=\"https://ru.wikihow.com/%D0%B2%D0%B5%D1%81%D1%82%D0%B8-%D1%81%D0%B5%D0%B1%D1%8F-%D1%83%D0%B2%D0%B5%D1%80%D0%B5%D0%BD%D0%BD%D0%BE\" target=\"_blank\" style=\"background-color: transparent; color: rgb(48, 117, 48);\">уверенность</a><span style=\"background-color: transparent; color: rgb(48, 117, 48);\"> </span><span style=\"background-color: transparent;\">до тех пор, пока не поверите в себя. Даже если вам неловко, уверенный язык тела поможет создать иллюзию расслабленности.</span></p><p class=\"ql-align-justify\">	<strong style=\"background-color: transparent;\">&nbsp;&nbsp;7) Откажитесь от предубеждений.</strong><span style=\"background-color: transparent;\">&nbsp;В университете встречаются люди из разных мест и социальных групп. Не списывайте человека со счетов лишь потому, что он не похож на вас и ваших школьных товарищей. Не вешайте сразу на человека ярлыки, даже если кажется на первый взгляд, что вы разные. Не все обязательно должны становиться вашими друзьями на век, и не обязательно иметь одинаковые на все взгляды. Общаться с разными людьми полезно, так как начинаешь видеть разные точки зрения.</span></p><p class=\"ql-align-justify\">	<strong style=\"background-color: transparent;\">&nbsp;&nbsp;8) Найдите более общительного друга.</strong><span style=\"background-color: transparent;\">&nbsp;Среди студентов встречаются самые разные личности. Кто-то стеснительный, а кто-то душа компании. Конечно, во всем важно равновесие, но найдите хотя бы одного человека с выдающимися навыками общения, который любит знакомиться и всегда найдет веселое занятие. С таким человеком вам будет проще находить новых знакомых и, как следствие, потенциальных друзей.</span></p><p class=\"ql-align-justify\">	<strong style=\"background-color: transparent;\">&nbsp;&nbsp;9) </strong><a href=\"https://ru.wikihow.com/%D0%B1%D1%8B%D1%82%D1%8C-%D1%81%D0%B0%D0%BC%D0%B8%D0%BC-%D1%81%D0%BE%D0%B1%D0%BE%D0%B9\" target=\"_blank\" style=\"background-color: transparent; color: rgb(0, 0, 0);\"><strong>Оставайтесь собой</strong></a><strong style=\"background-color: transparent;\">.</strong><span style=\"background-color: transparent;\">&nbsp;Все слышали эту фразу бесчисленное количество раз, но не будет лишним повториться. В конечном счете все хотят, как можно скорее обзавестись друзьями в университете, поэтому пытаются измениться, чтобы соответствовать чужим взглядам. Вынужденная дружба не приведет ни к чему хорошему. Настоящая длительная дружба всегда основана на искренности и лишена притворства. Не думайте о недостатках и сосредоточьтесь на своих достоинствах.&nbsp;</span></p><p><br></p><p class=\"ql-align-justify\">	Университетская жизнь волнует и пугает одновременно. Студент обретает свободу, но при этом попадает в новую обстановку, полную сотен незнакомых людей. Завести новых друзей можно лишь благодаря сознательным усилиям. Сделайте глубокий вдох и выходите из зоны комфорта. Потенциальные друзья не придут к вам в комнату, чтобы познакомиться. Вступайте в беседы с одногруппниками, проводите время в копании новых знакомых и участвуйте в общественной жизни университета. Не бойтесь новизны, но всегда оставайтесь собой.<span style=\"background-color: transparent;\">&nbsp;</span></p><p class=\"ql-align-justify\">	<span style=\"background-color: transparent;\">Мы надеемся, что наши советы помогут студентам справиться с такой трудностью как социализация. Мы все понимаем, как иногда трудно начать разговор, пересилить свои страхи и просто вписаться в какую-то группу общения. Помните, что большую часть своих переживаний вы, скорее всего, себе надумываете или преувеличиваете. Общение с новыми людьми — это не такая страшная вещь, как иногда кажется с первого взгляда. Достаточно лишь немного открыться и сделать первые шаги в сторону общения.</span></p><p><br></p><p><br></p>', '68654a1a8b1a4.jpg', 'Социализация', 1);
