INSERT INTO `posts` (`Id`, `Title`, `Short`, `Published`, `Info`, `Preview`, `Theme`, `Type`) VALUES
(33, 'Как научиться эффективно сочетать работу и учебу?', '', '2025-07-02', '<p class=\"ql-align-center\"><strong style=\"background-color: transparent;\">Можно ли одновременно учиться и работать?</strong></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Зачастую студенты сочетают работу и учебу. Это могут быть различные формы, например, работа по совместительству, удаленная работа, полная занятость, когда студент вынужден работать, чтобы зарабатывать деньги или помогать в семейном бизнесе, работа, которая является частью учебной программы, учебного курса.</span></p><p><br></p><p class=\"ql-align-center\"><strong style=\"background-color: transparent;\"><em>Есть ли преимущества в сочетании работы и учебы?</em></strong></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Работая, Вы одновременно приобретаете:</span></p><ul><li class=\"ql-align-justify\"><span style=\"background-color: transparent;\">широкий спектр навыков и опыт профессиональной деятельности;</span></li><li class=\"ql-align-justify\"><span style=\"background-color: transparent;\">быстрое взросление и уверенность в своих силах;</span></li><li class=\"ql-align-justify\"><span style=\"background-color: transparent;\">профессиональные знания;</span></li><li class=\"ql-align-justify\"><span style=\"background-color: transparent;\">понимание связей между академической теорией и практикой;</span></li><li class=\"ql-align-justify\"><span style=\"background-color: transparent;\">доход, который приносит работа;</span></li><li class=\"ql-align-justify\"><span style=\"background-color: transparent;\">общественные и профессиональные контакты.</span></li></ul><p><br></p><p class=\"ql-align-center\"><strong style=\"background-color: transparent;\">Как научиться эффективно сочетать работу и учебу?</strong></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Прежде чем сочетать работу и учебу необходимо:</span></p><ul><li class=\"ql-align-justify\"><span style=\"background-color: transparent;\">убедиться в том, что Вы сможете присутствовать на всех занятиях;</span></li><li class=\"ql-align-justify\"><span style=\"background-color: transparent;\">предусмотреть, что может случиться что-то непредвиденное, например, командировка в другой город;</span></li><li class=\"ql-align-justify\"><span style=\"background-color: transparent;\">понимать, что Ваше расписание может меняться от семестра к семестру.</span></li></ul><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Если Вы решили совмещать учебу и работу, и Ваш работодатель настроен доброжелательно, Вам следует:</span></p><ul><li class=\"ql-align-justify\"><span style=\"background-color: transparent;\">обсудить с работодателем наилучший способ распределения служебных и учебных обязанностей;</span></li><li class=\"ql-align-justify\"><span style=\"background-color: transparent;\">обсудить с работодателем вопрос о том, готов ли он предоставить учебный отпуск, например, на время сессии;</span></li><li class=\"ql-align-justify\"><span style=\"background-color: transparent;\">разрешает ли работодатель использовать рабочее время для учебы на рабочем месте;</span></li><li class=\"ql-align-justify\"><span style=\"background-color: transparent;\">планируйте и максимально эффективно используйте учебное время;</span></li><li class=\"ql-align-justify\"><span style=\"background-color: transparent;\">спланируйте его заранее, определите конкретные задания, «контрольные точки», которые Вам необходимо будет выполнить;</span></li><li class=\"ql-align-justify\"><span style=\"background-color: transparent;\">если работодатель разрешает заниматься на работе, найдите спокойное место для занятий, если есть возможность и работодатель разрешает, используйте онлайн-ресурсы.</span></li></ul><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Совмещая работу и учебу, подумайте о возможных потерях, например, будет ли у Вас меньше времени для учебы, семьи, друзей? Какие еще потери могут Вам грозить? Поразмышляйте над тем, как Вы можете преодолеть возникшие трудности, связанные с совмещением учебы и работы.</span></p><p><br></p>', '686557f7cf95a.jpg', 'Советы', 1),
(34, 'Памятка по применению электронных ресурсов для литературы', 'Откройте вкладку в ЕТИС ПГНИУ «Электронные ресурсы», познакомьтесь с перечнем предоставляемых ресурсов с логином и паролем, например:', '2025-07-02', '<p class=\"ql-align-center\"><span style=\"background-color: transparent; color: rgb(0, 0, 10);\">&nbsp;Памятка по применению электронных ресурсов для рекомендуемой литературы</span></p><p><br></p><ol><li class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Откройте вкладку в ЕТИС ПГНИУ «Электронные ресурсы», познакомьтесь с перечнем предоставляемых ресурсов с логином и паролем, например:</span></li></ol><p><br></p><p><img src=\"https://lh7-rt.googleusercontent.com/docsz/AD_4nXdwy_i7NlJnOYaUxxlHPMr2V27su88k4bevZZRTyG_aFcwu6BDP7nQ_SJ04QuXGqPJt65pQkRZUBaVNV1rpODP2psvczMSKUGSJYZ_ELkvLOPV_SDa0ijUJWGBscqtgd2SVQX2vazL_3GwWw-c55A?key=L7cE1kLvZKhpGv40F8YSrQ\" height=\"460.87762589270557\" width=\"818.9133376059247\"></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><ol><li><span style=\"background-color: transparent; color: rgb(0, 0, 10);\">Откройте вкладку в ЕТИС ПГНИУ «Библиотека», где предоставлен список рекомендуемой литературы, например:</span><span style=\"background-color: transparent;\"><img src=\"https://lh7-rt.googleusercontent.com/docsz/AD_4nXdav577L4PAIBoybD3BjnRFADGqfC77rubTWiNBGRvkljDUQqfXAngoPpzAYpBDywKVP-ueP3EDN5fAlIOZoqTp3CCCOwU9kC4ZfMhS3ZIXvuc12qsjtQAKxacyPBA456rn416HrBOmxWnlrvAcwCg?key=L7cE1kLvZKhpGv40F8YSrQ\" height=\"434.43353166965454\" width=\"772.5704691824394\"></span></li><li><span style=\"background-color: transparent;\">Выбираем нужную ссылку литературы, например вторую строку из обязательной литературы:</span></li></ol><p><span style=\"background-color: transparent;\"><img src=\"https://lh7-rt.googleusercontent.com/docsz/AD_4nXfbBytfH4mreIwcZFtIf0k5baMq1UU69Y-IZT95uUGRzAwe90u0LezH_4uGm2NbHkGxzdUF_0Vhx14BqffPpgcG9zyl0smwP58VFRF8MzoxBnSWNrOpm6mlObzxfJJPAaEJRe_CtjHIyIR7S0m7x2U?key=L7cE1kLvZKhpGv40F8YSrQ\" height=\"350.8504309358554\" width=\"623.4079635339858\"></span></p><ol><li class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Чтобы чтение&nbsp; ONLAIN было доступно, нажимаем в верхнем правом углу на сайте стрелку в «личный кабинет», где указываем логин и пароль из вкладки ЕТИС ПГНИУ «Электронные ресурсы» и получается чтение книги доступно:</span></li></ol><p><span style=\"background-color: transparent;\"><img src=\"https://lh7-rt.googleusercontent.com/docsz/AD_4nXfgAADlKbBDqOp2q0z6e3qWaTDEPc9J9tIFw24JITf4v-Co8S46Rdw966pwXBI1QBQaQG4u44KBRPayYxNhXCt5KqR0N7IYAq0NBhk5pCbI0Cbkd72i70WveDwtbK_Wwu6WSMKyLcukvEzk5jjbEQ?key=L7cE1kLvZKhpGv40F8YSrQ\" height=\"350.7257324772028\" width=\"624.3091909487313\"></span></p><ol><li class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Нажимаете на кнопку «ЧИТАТЬ», и открывается доступное чтение&nbsp; ONLAIN этой книги на электронном ресурсе с оглавлением, списком закладок, окном конспектов и возможностью показать миниатюры:</span></li></ol><p><span style=\"background-color: transparent;\"><img src=\"https://lh7-rt.googleusercontent.com/docsz/AD_4nXcutXGGgjKmBAIxHLfpZGH_1Bcai1wI8rAqemql4GX7LKQWiPEyT1KUOAiBQEXsc9Z7HlAMD3vZsT_ff9hCpguo9z3tM59PkCJIIk2TBpY-bzRS5x_tOZLRoYan0mi7c7N-FavzDYAP1zSrzqvMTSM?key=L7cE1kLvZKhpGv40F8YSrQ\" height=\"350.71567918283245\" width=\"623.8634402750309\"></span></p><ol><li><span style=\"background-color: transparent;\">Заходите чаще в раздел </span><span style=\"background-color: transparent; color: rgb(0, 0, 10);\">«Библиотека» в ЕТИС ПГНИУ и читайте обязательную и дополнительную литературу.&nbsp;</span></li><li><span style=\"background-color: transparent; color: rgb(0, 0, 10);\">Если хотите почитать какие-нибудь интересующие книги, журналы по необходимому профилю заходите на сайт </span><a href=\"https://ibooks.ru/\" target=\"_blank\" style=\"background-color: transparent; color: rgb(0, 0, 10);\">ЭБС ibooks.ru</a><span style=\"background-color: transparent; color: rgb(0, 0, 10);\">:</span></li></ol><p><span style=\"background-color: transparent;\"><img src=\"https://lh7-rt.googleusercontent.com/docsz/AD_4nXcaRMc4J8lhVkNNoP0QC2GJ54MX1ntzbyMgqsG6LSL-GtBs5zghGrrJcdi8-aYL0JYGU75o6KP9tvwgDYTjwqA0fccxjdACLLhPlf3HJ_XPV_Cxk84GGjJ6VZF_Kf2Iv2QtH-sbVmvTRKbKLqzc88c?key=L7cE1kLvZKhpGv40F8YSrQ\" height=\"350.91607565011816\" width=\"623.4211685091196\"></span></p><p><span style=\"background-color: transparent;\">Вот так выглядит каталог книг, например, на сайте </span><a href=\"https://ibooks.ru/\" target=\"_blank\" style=\"background-color: transparent; color: rgb(0, 0, 10);\">ЭБС ibooks.ru</a><span style=\"background-color: transparent; color: rgb(0, 0, 10);\">:</span></p><p><span style=\"background-color: transparent;\"><img src=\"https://lh7-rt.googleusercontent.com/docsz/AD_4nXdy_B2btsJLPc4vvG_rnAIn-yA_k0jGgeIVk8cm8w9vuocjPoVKRR1_BcTi6gKXwZzEYwX1NukXjx_OrhnyOnGecFBLwckFyHElnhf58OXosIQrVK2-TLlVYv1shX8oQe1vlsu4xBgKeyCr1-DVGg?key=L7cE1kLvZKhpGv40F8YSrQ\" height=\"407.58239881596177\" width=\"726.8913640966296\"></span></p><p><span style=\"background-color: transparent;\">Удачи в получении знаний! Приятного чтенепровождения на сайте ЕТИС ПГНИУ!</span></p><p><br></p><p><br></p>', '68655a3d4c75f.jpg', 'Советы', 1),
(35, 'Для повышения уверенности в себе', 'Постоянно совершенствуйте свои профессиональные навыки, читайте специальную литературу, посещайте профессиональные интернет-форумы. Знание последних тенденций в своей области деятельности вселит в вас обоснованную уверенность в вашей компетентности.', '2025-07-02', '<p class=\"ql-align-center\"><strong style=\"background-color: transparent;\">Рекомендации и советы для повышения уверенности в себе</strong></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">- Постоянно совершенствуйте свои профессиональные навыки, читайте специальную литературу, посещайте профессиональные интернет-форумы. Знание последних тенденций в своей области деятельности вселит в вас обоснованную уверенность в вашей компетентности.</span></p><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">- Ставьте себе реалистичные задачи.</span></p><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">- Мы получаем негативную обратную связь чаще, чем позитивную. Поэтому больше сосредотачиваем внимание на своих слабостях, а не на сильных сторонах. И совершенствуем их.</span></p><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">- Старайтесь, не забывая о своих слабостях, всегда помнить о своих сильных сторонах и использовать их.</span></p><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">- Регулярно получайте обратную связь от друзей, знакомых, членов семьи. Это научит вас относиться к ней спокойнее и сделает вашу самооценку более объективной.</span></p><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">- Важно научиться выборочно относиться к негативной обратной связи. Спрашивать себя: а компетентен ли тот человек, который меня критикует? как он это делает? С какой целью? Критика должна быть обоснованной и не задевать вашу личность.</span></p><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">– Не ругайте и не унижайте себя. Никогда не говорите о себе в негативном свете, постарайтесь избегать себе отрицательные черты – «глупый», «уродливый», «неспособный», «неисправимый».</span></p><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">- Всегда проверяйте объективность критериев оценки своих действий, когда вы обсуждаете их с самим собой.</span></p><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">- Прекратите сравнивать себя с другими людьми.</span></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Когда люди начинают сравнивать себя с другими, они часто проигрывают в этой битве, потому что сравниваю себя с теми людьми, которые добились большего успеха или лучше их в чем-то. Не нужно этого делать, у всех есть свои собственные достоинства и недостатки. Быть самим собой – наилучший из вариантов. Единственным плюсом, когда сравнение идет на пользу развития личности, будет только то, когда человек начнет сравнивать свои достижения со своими прошлыми достижениями.</span></p><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">- Постарайтесь находиться среди веселых, оптимистичных и уверенных в себе людей.</span></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Всегда старайтесь находиться с людьми, которые с уважением относятся к себе и своему окружению, их позитивный настрой передается каждому, кто находится рядом с ними. Меньше находитесь среди людей, которые подавляют Вас, сомневаются в Ваших способностях, так как своими высказываниями они могут оказать негативное влияние на Вашу самооценку.</span></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">- Старайтесь погрузиться в то, что вы любите и что вам интересно.</span></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Получать истинное удовольствие от жизни довольно трудно, если Вы занимаетесь не любимой деятельностью. Чувство собственного достоинства невозможно пошатнуть, когда вы заняты любимым делом - ведь если вам нравится это делать, у вас это отлично получается. А если у Вас отсутствует возможность прекратить нелюбимую деятельность, то хотя бы посвящайте своё свободное время тому, что доставляет Вам удовольствие.</span></p><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">- Следите за своей речью.</span></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Слова несут в себе силу, так как характеризуют говорящего. Поэтому старайтесь, чтобы Ваши слова соответствовали действительности. Следите за тоном, используемый Вами в своей речи, и постарайтесь говорить размеренно и уверенно, вместо резкого и заискивающего тона.</span></p><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">- Планируйте, расставляйте приоритеты и будьте организованны</span></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Вам следует осознавать, где Вы находитесь сейчас, куда хотите попасть и как планируете это сделать. Точно понимайте, чего хотите. Все вопросы тщательно взвешивайте и планируйте. Решите, каким будет ваш первый шаг, и сделайте его. Будьте готовы суметь подкорректировать свой план по мере необходимости. Какая бы задача перед вами ни стояла, подготовьтесь к ней основательно. Если возможно, заранее отрепетируйте свои действия, например, выступление с бизнес-проектом. Уделите этому должное внимание, и вы не только подготовитесь к предстоящему событию, но и повысите свою уверенность и самооценку</span></p><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">- Помните, что иногда поражение можно рассматривать, как удачу (Вы всегда можете сделать из него выводы, что Вы преследовали ошибочные цели, которые не стоили Ваших усилий, что Вам удалось избежать последующих более крупных неприятностей).</span></p><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">- Постоянно практикуйте навыки общения. Старайтесь быть конструктивными, наслаждайтесь ощущением той энергетики, которой обмениваются люди. Поймите, что все люди очень разные и все очень своеобразны. Каждый человек индивидуален. Осознайте, что Вы хотите получить от людей, и что можете дать им вы. Научитесь быть открытыми для такого обмена. Всегда помните, что каждый может испытывать страх и неуверенность, постарайтесь помочь такому неуверенному человеку.</span></p><p><br></p><p><br></p>', '68655ada4f2e4.jpeg', 'Самосовершенствование', 1),
(36, 'Цифровой этикет для студентов', 'Цифровой этикет – это правила общения в интернете, мессенджерах и электронной почте.', '2025-07-02', '<p class=\"ql-align-center\"><strong style=\"background-color: transparent;\">Цифровой этикет для студентов Пермского Государственного Научного Исследовательского Университета</strong></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Цифровой этикет – это правила общения в интернете, мессенджерах и электронной почте.&nbsp;</span></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">Вот некоторые правила, благодаря которым Ваше взаимодействие с преподавателями университета будет эффективным, уважительным и не будет нарушать личных границ:</span></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">1. Отправлять письма в мессенджерах или по электронной почте преподавателю необходимо ТОЛЬКО в будние дни и ТОЛЬКО с 10.00 до 20.00.&nbsp;</span></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">2. Ваше сообщение должно быть кратким, лаконичным, грамотным. Избегайте грамматических, орфографических и пунктуационных ошибок.&nbsp;</span></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">3. Обязательно представьтесь в письме, указав ФИО и номер вашей группы.&nbsp;</span></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">4. Избегайте звонков, аудио- и видео-сообщений в мессенджерах, всю информацию необходимо излагать в письменном виде.&nbsp;</span></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">5. Если вам кажется, что в вашей ситуации избежать голосового сообщения невозможно, то соблюдайте 3 основных правила:</span></p><p class=\"ql-align-justify\">	<span style=\"background-color: transparent;\">а) В письменном виде спросите у преподавателя, которому вы планируете записать голосовое сообщение, можете ли вы это сделать голосом?</span></p><p class=\"ql-align-justify\">	<span style=\"background-color: transparent;\">б) Длина вашего голосового сообщения не должна превышать 15 секунд.&nbsp;</span></p><p class=\"ql-align-justify\">	<span style=\"background-color: transparent;\">в) Главные тезисы и цифры продублируйте текстом.&nbsp;</span></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">6. Если Ваш вопрос требует звонка по телефону, будет вежливо и уместно, если Вы спросите разрешение об этом, предварительно написав в мессенджере. Уточните, удобно ли будет преподавателю созвониться с вами по вашему вопросу и договоритесь о точном времени звонка.&nbsp;</span></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">7. Если преподаватель Вам не отвечает, то вы можете напомнить ему о себе, продублировав ваше письмо, не ранее, чем через 3 дня.&nbsp;</span></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">8. Помните, что некоторые формулировки звучат в речи доброжелательно, благодаря интонации, а на письме могут выглядеть строго или грубо. Старайтесь формулировать вашу письменную речь так, чтобы она звучала уважительно.&nbsp;</span></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">9. Избегайте смайликов, стикеров, картинок и любых других фамильярных форм взаимодействия. Ваше общение с преподавателем, прежде всего, деловое.&nbsp;</span></p><p class=\"ql-align-justify\"><span style=\"background-color: transparent;\">10. Старайтесь с самого начала вашей коммуникации с преподавателем соблюдать и уважать границы друг друга. Для этого заранее:</span></p><p><span style=\"background-color: transparent;\">- определите основной канал связи;</span></p><p><span style=\"background-color: transparent;\">- определите резервный канал связи;</span></p><p><span style=\"background-color: transparent;\">- договоритесь о времени связи. </span></p><p><br></p><p><br></p>', '68655b5b368d9.jpg', 'Социализация', 1);

